import React from "react";

function Card(props){
    return(
        <div id="mycard">
            <div class="card">
                <div class="card-body">
                <h5 class="card-title">{props.name}</h5>
                <p class="card-text">{props.desc}</p>
                <button class="btn btn-primary" style={{backgroundColor: "#263145", borderRadius: "10px", border:"none"}}>Solve Algorithm</button>
            
                </div>
            </div>
        </div>
    )
}

export default Card;
